(5428, 'Programa Salud Integral, cual constará de consultas en materia de salud reproductiva y sexual, dinámicas en materia de seguridad vial, capacitaciones y asesoramiento en materia de prevención de las adicciones.', 'Coadyuvar en la disminución del 1.5% de personas jóvenes con carencia por acceso a los servicios de salud en Querétaro. (1,500 jóvenes vinculados algún servicio de salud integral y preventiva).', NULL, 'Programa Salud Integral, cual constará de consultas en materia de salud reproductiva y sexual, dinámicas en materia de seguridad vial, capacitaciones y asesoramiento en materia de prevención de las adicciones.', 1, 146, 'Programa Salud Integral, cual constará de consultas en materia de salud reproductiva y sexual, dinámicas en materia de seguridad vial, capacitaciones y asesoramiento en materia de prevención de las adicciones.', 0, NULL, NULL, NULL, NULL, 0, 1058, NULL, 'Programa Salud Integral, cual constará de consultas en materia de salud reproductiva y sexual, dinámicas en materia de seguridad vial, capacitaciones y asesoramiento en materia de prevención de las adicciones.', '\nTrabajar en la concientización y el fomento de la salud integral de las y los jóvenes de 12 a 29 años en los 18 municipios del Estado de Querétaro, así como en la prevención de conductas de riesgo a través de talleres, capacitaciones, dinámicas, estudios y consultas.', 1, 'poa', NULL),
(5429, 'Programa Salud Mental, el cual constará de capacitaciones y terapias psicológicas, así como intervenciones, talleres y dinámicas en materia de gestión emocional.', 'Lograr que 2,500 jóvenes hayan participado en el programa de salud preventiva, integral y nutrición de la secretaría.', NULL, 'Programa Salud Mental, el cual constará de capacitaciones y terapias psicológicas, así como intervenciones, talleres y dinámicas en materia de gestión emocional.', 1, 146, 'Programa Salud Mental, el cual constará de capacitaciones y terapias psicológicas, así como intervenciones, talleres y dinámicas en materia de gestión emocional.', 0, NULL, NULL, NULL, NULL, 0, 1059, NULL, 'Programa Salud Mental, el cual constará de capacitaciones y terapias psicológicas, así como intervenciones, talleres y dinámicas en materia de gestión emocional.', '\nTrabajar en la concientización y el fomento de la salud integral de las y los jóvenes de 12 a 29 años en los 18 municipios del Estado de Querétaro, así como en la prevención de conductas de riesgo a través de talleres, capacitaciones, dinámicas, estudios y consultas.', 1, 'poa', NULL),
(5430, 'Programa Juventud Lidera, el cual constará de dotar a las y los jóvenes del Estado de Querétaro de herramientas prácticas como becas, diplomados, certificaciones, cursos, talleres y capacitaciones encaminadas a propiciar la inclusión laboral de aquellos jóvenes que están buscando insertarse en la dinámica económica del Estado. ', 'Aumentar la participación de los jóvenes en la dinámica económica del estado en un 22% a través de la generación de empleo formal (3,000 empleos formales).', NULL, 'Programa Juventud Lidera, el cual constará de dotar a las y los jóvenes del Estado de Querétaro de herramientas prácticas como becas, diplomados, certificaciones, cursos, talleres y capacitaciones encaminadas a propiciar la inclusión laboral de aquellos jóvenes que están buscando insertarse en la dinámica económica del Estado. ', 1, 146, 'Programa Juventud Lidera, el cual constará de dotar a las y los jóvenes del Estado de Querétaro de herramientas prácticas como becas, diplomados, certificaciones, cursos, talleres y capacitaciones encaminadas a propiciar la inclusión laboral de aquellos jóvenes que están buscando insertarse en la dinámica económica del Estado. ', 0, NULL, NULL, NULL, NULL, 0, 1069, NULL, 'Programa Juventud Lidera, el cual constará de dotar a las y los jóvenes del Estado de Querétaro de herramientas prácticas como becas, diplomados, certificaciones, cursos, talleres y capacitaciones encaminadas a propiciar la inclusión laboral de aquellos jóvenes que están buscando insertarse en la dinámica económica del Estado. ', ' Trabajar en favor de la inclusión económica de las y los jóvenes de 15 a 29 años en los 18 municipios del Estado de Querétaro, impulsándolos a través del otorgamiento de herramientas prácticas que fortalezcan sus competencias en el mercado laboral, así como esquemas que los vinculen con la oferta laboral del Estado.', 3, 'poa', NULL),
(5431, 'Programa Objetivo Servir, el cual a través de la participación y el voluntariado se buscará impactar de forma positiva desarrollando proyectos sociales e intervenciones sociales en zonas marginales y/o rurales del Estado.', 'Disminuir el 0.5% de  porcentaje de personas con carencias promedio de la población en situación de pobreza, según entidad federativa (2020)\npoblación de 12 y 29 años.', NULL, 'Programa Objetivo Servir, el cual a través de la participación y el voluntariado se buscará impactar de forma positiva desarrollando proyectos sociales e intervenciones sociales en zonas marginales y/o rurales del Estado.', 1, 146, 'Programa Objetivo Servir, el cual a través de la participación y el voluntariado se buscará impactar de forma positiva desarrollando proyectos sociales e intervenciones sociales en zonas marginales y/o rurales del Estado.', 0, NULL, NULL, NULL, NULL, 0, 1063, NULL, 'Programa Objetivo Servir, el cual a través de la participación y el voluntariado se buscará impactar de forma positiva desarrollando proyectos sociales e intervenciones sociales en zonas marginales y/o rurales del Estado.', 'Brindar apoyo para el acceso a una vivienda digna a todos los sectores de la población, principalmente a los segmentos más vulnerables.\nEntregar apoyos a población en estado de vulnerabilidad. ', 1, 'poa', NULL),
(5432, 'Casa SEJUVE, centro de desarrollo juvenil que busca atender a los jóvenes del Estado de Querétaro en las áreas de emprendimiento, salud, inclusión, educación complementaria y desarrollo profesional.', 'Aumentar la cobertura total de atención a jóvenes de la Secretaría de la Juventud un 2% más de la operación normal que tiene la dependencia en un periodo de un año.', NULL, '\r\nCasa SEJUVE, centro de desarrollo juvenil que busca atender a los jóvenes del Estado de Querétaro en las áreas de emprendimiento, salud, inclusión, educación complementaria y desarrollo profesional.', 1, 146, 'Casa SEJUVE, centro de desarrollo juvenil que busca atender a los jóvenes del Estado de Querétaro en las áreas de emprendimiento, salud, inclusión, educación complementaria y desarrollo profesional.', 0, '.', '.', '.', '.', 1, 1058, 'Validar datos', '\r\nCasa SEJUVE, centro de desarrollo juvenil que busca atender a los jóvenes del Estado de Querétaro en las áreas de emprendimiento, salud, inclusión, educación complementaria y desarrollo profesional.', 'Aumentar el impacto y la cobertura de servicios que ofrece la Secretaría de la Juventud, a través de un Centro de Desarrollo Juvenil para la atención de las y los jóvenes del Estado de Querétaro, respondiendo a diferentes áreas y temáticas que den razón a  los principales focos de atención de la población joven.', 1, 'poa', '0'),
